class Solution {
public:
    int compareVersion(string v1, string v2) {
        queue<int> q1;
        string temp = "";
        for(auto i : v1){
            if(i == '.'){
                q1.push(stoi(temp));
                temp = "";
            }else{
                temp.push_back(i);
            }
        }
        q1.push(stoi(temp));

        queue<int> q2;
        temp = "";
        for(auto i : v2){
            if(i == '.'){
                q2.push(stoi(temp));
                temp = "";
            }else{
                temp.push_back(i);
            }
        }
        q2.push(stoi(temp));

        while(!q1.empty() && !q2.empty()){
            int f1 = q1.front();
            int f2 = q2.front();
            q1.pop();
            q2.pop();
            if(f1 > f2){
                return 1;
            }else if(f1 < f2){
                return -1;
            }
        }
        while(!q1.empty()){
            if(q1.front() == 0){
                q1.pop();
            }else{
                break;
            }
        }
        while(!q2.empty()){
            if(q2.front() == 0){
                q2.pop();
            }else{
                break;
            }
        }
        if(q1.empty() && q2.empty()){
            return 0;
        }
        if(q2.empty()){
            return 1;
        }
        if(q1.empty()){
            return -1;
        }
        return 0;      
    }
};
